  true,\n\t\"url\": null,\n\t\"notes\": \"The Office of the Inspector General (OIG)
  is an independent office within the Office of Personnel Management (OPM) dedicated
  to promoting accountability and transparency both within and outside of the agency.
  \ Its mission is to provide independent and objective oversight of OPM services
  and programs by conducting audits, investigations, and evaluations.  The OIG provides
  recommendations to help improve the efficiency and effectiveness of OPM's operations.
  The Inspector General Act of 1978, as amended, requires that all audit and other
  reports performed by Federal Inspectors General are posted on their websites. This
  data asset consists of audit reports.\",\n\t\"license_title\": \"U.S. Government
